/*
|  Mac OS X
|  This source file will serve two purposes for OS X builds. First, it will
|  define the keys and default values to use for string lookups. The keys will
|  be string-ized versions of the string IDs, and the default values will be
|  the equivalent string as defined in lodlgstr.h.
|  This will also be used as input to Apple's genstrings utility for creating
|  the localizable string file (in
|  libsc_lo.bundle/Contents/Resources/English.lproj/Localizable.strings).
|  Genstrings will parse NSLocalizedStringWithDefaultValue macros to get the
|  strings for this file.
|  Genstrings will be run via a shell script build phase, which will define
|  SCC_GENSTRINGS. In this case, we want to surround the strings with the
|  NSLocalizedStringWithDefaultValue macro so genstrings can do its job.
|  During the normal build phase (SCC_GENSTRINGS not defined), the table just
|  contains C strings and the localization macro will be used by LOGetString to
|  perform the lookup.
*/

#define SCC_CASTSTRING

#if defined(SCC_GENSTRINGS)

/* Building the string table. Set up the macro call for genstrings. */
#define SCC_LOCALIZESTRING(s)  \
  NSLocalizedStringWithDefaultValue(@#s, nil, LOGetBundle(), @s, @#s)

#else

/*
|  Normal build. Construct the string literals for the key and default.
|  The key is just the string-ized ID.
*/
#define SCC_LOCALIZESTRING(s) \
  (VTCHAR *)#s, (VTCHAR *)s

#endif /* SCC_GENSTRINGS */

#else

#define SCC_CASTSTRING   (VTCHAR *)
#define SCC_LOCALIZESTRING(s)   s

#endif /* _DARWIN_SOURCE */

#define LO_FISTR_DEFINE(finame)  { SCCIDTYPE_STRING | finame,  SCC_CASTSTRING SCC_LOCALIZESTRING(STR_##finame) }
